import React, {Fragment} from 'react';
import styled from 'styled-components';


const audioPlayer = () => (
	<Fragment>
		<audio>
		<source src=".mp3" type="audio/mpeg" />
		Your browser does not support the audio element.
		</audio>
	</Fragment>
)

export default audioPlayer;
